import axios from "@/axios";

class adminRestApi{

    async countBloodOrg(){
        try {
            return await axios.get(
              "api/admin/total-number-of-blood-organization",
              accountClass
            );
          } catch (error) {
            console.log(error);
          }
    }

    async countBloodDonor(){
        try {
            return await axios.get(
              "api/admin/total-number-of-blood-donors",
              accountClass
            );
          } catch (error) {
            console.log(error);
          }
    }

    async countEyeOrg(){
        try {
            return await axios.get(
              "api/admin/total-number-of-eye-organization",
              accountClass
            );
          } catch (error) {
            console.log(error);
          }
    }

    async countEyeDonor(){
        try {
            return await axios.get(
              "api/admin/total-number-of-eye-donors",
              accountClass
            );
          } catch (error) {
            console.log(error);
          }
    }
}
export default new adminRestApi();
